import { BrowserRouter as Router, Route, Routes} from 'react-router-dom';
import Navbar from './components/Navbar';
import Landing from './components/pages/Landing'

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/">
          <Landing/>
        </Route>
      </Routes>
    </Router>
  );
}

export default App;
